import React from "react";
import "./AppHeader"

const AppHeader = ( {todosNeedDone, todosDone} ) => {

    return (
        <h3 className="app-header d-flex">
            {`${todosDone} have already done! ${todosNeedDone} are waiting!`}
        </h3>
    )
}

export default AppHeader;
